### use `&`, `|`, `~` for logical operations on numpy arrays
### can use functions from `math`, `np` (numpy), and `ak` in the expression

## Note: hww has fake fj_isQCD=1.. However in below selection we do not select label_H_wwunmatch in training pool
selection: >-
    (jet_tightId==1) & (jet_no<2) & (fj_pt>200) & (fj_pt<2000) & (fj_sdmass>=20) & (fj_sdmass<260) &
    (
      (label_H_ww3q_0c>0)|(label_H_ww3q_1c>0)|(label_H_ww3q_2c>0)|(label_H_ww4q_0c>0)|(label_H_ww4q_1c>0)|(label_H_ww4q_2c>0)|
      (label_H_wwevqq_0c>0)|(label_H_wwevqq_1c>0)|(label_H_wwmvqq_0c>0)|(label_H_wwmvqq_1c>0)|(label_H_wwhadtauvqq_0c>0)|
      (label_H_wwhadtauvqq_1c>0)|(label_H_wwleptauevqq_0c>0)|(label_H_wwleptauevqq_1c>0)|(label_H_wwleptaumvqq_0c>0)|(label_H_wwleptaumvqq_1c>0)|
      (label_H_bb>0)|(label_H_cc>0)|(label_H_ss>0)|(label_H_qq>0)|(label_H_leptauehadtau>0)|(label_H_leptaumhadtau>0)|(label_H_hadtauhadtau>0)|
      (label_Top_bc>0)|(label_Top_bcq>0)|(label_Top_bev>0)|(label_Top_bhadtauv>0)|(label_Top_bleptauev>0)|(label_Top_bleptaumv>0)|(label_Top_bmv>0)|(label_Top_bq>0)|(label_Top_bqq>0)|
      (
        ((label_QCD_b>0)|(label_QCD_bb>0)|(label_QCD_c>0)|(label_QCD_cc>0)|(label_QCD_others>0)) & (sample_isQCD_real==1) & (fj_isQCD==1) & (event_no%7!=0)
      )
    )
### selection to apply at test time (i.e., when running w/ --predict)
# note that we use variable-mass ttbar for training, but only 1/7 of the Z'-> SM ttbar sample for reference
test_time_selection: >-
    (jet_tightId==1) & (jet_no<2) & (fj_pt>200) & (fj_pt<2000) & (fj_sdmass>=20) & (fj_sdmass<260) &
    (
      (label_H_ww3q_0c>0)|(label_H_ww3q_1c>0)|(label_H_ww3q_2c>0)|(label_H_ww4q_0c>0)|(label_H_ww4q_1c>0)|(label_H_ww4q_2c>0)|
      (label_H_wwevqq_0c>0)|(label_H_wwevqq_1c>0)|(label_H_wwmvqq_0c>0)|(label_H_wwmvqq_1c>0)|(label_H_wwhadtauvqq_0c>0)|
      (label_H_wwhadtauvqq_1c>0)|(label_H_wwleptauevqq_0c>0)|(label_H_wwleptauevqq_1c>0)|(label_H_wwleptaumvqq_0c>0)|(label_H_wwleptaumvqq_1c>0)|
      (label_H_bb>0)|(label_H_cc>0)|(label_H_ss>0)|(label_H_qq>0)|(label_H_leptauehadtau>0)|(label_H_leptaumhadtau>0)|(label_H_hadtauhadtau>0)|
      (
        ((label_Top_bc>0)|(label_Top_bcq>0)|(label_Top_bev>0)|(label_Top_bhadtauv>0)|(label_Top_bleptauev>0)|(label_Top_bleptaumv>0)|(label_Top_bmv>0)|(label_Top_bq>0)|(label_Top_bqq>0))
        & (event_no%7==0)
      )|
      (
        ((label_QCD_b>0)|(label_QCD_bb>0)|(label_QCD_c>0)|(label_QCD_cc>0)|(label_QCD_others>0)) & (sample_isQCD_real==1) & (fj_isQCD==1)
        & (event_no%14==0)
      )
    )
new_variables:
    ### [format] name: formula
    ### can use functions from `math`, `np` (numpy), and `ak` in the expression
    pfcand_mask: ak.ones_like(pfcand_etarel)
    sv_mask: ak.ones_like(sv_etarel)
    label_H_WqqWqq_0c: (label_H_ww4q_0c>0)
    label_H_WqqWqq_1c: (label_H_ww4q_1c>0)
    label_H_WqqWqq_2c: (label_H_ww4q_2c>0)
    label_H_WqqWq_0c: (label_H_ww3q_0c>0)
    label_H_WqqWq_1c: (label_H_ww3q_1c>0)
    label_H_WqqWq_2c: (label_H_ww3q_2c>0)
    label_H_WqqWev_0c: (label_H_wwevqq_0c>0)
    label_H_WqqWev_1c: (label_H_wwevqq_1c>0)
    label_H_WqqWmv_0c: (label_H_wwmvqq_0c>0)
    label_H_WqqWmv_1c: (label_H_wwmvqq_1c>0)
