preprocess:
    ### method: [manual, auto] - whether to use manually specified parameters for variable standardization
    method: manual
    ### data_fraction: fraction of events to use when calculating the mean/scale for the standardization
    data_fraction:

inputs:
    pf_features:
        length: 128
        pad_mode: wrap
        vars:
            ### [format 1]: var_name (no transformation)
            ### [format 2]: [var_name,
            ###              subtract_by(optional, default=None, no transf. if preprocess.method=manual, auto transf. if preprocess.method=auto),
            ###              multiply_by(optional, default=1),
            ###              clip_min(optional, default=-5),
            ###              clip_max(optional, default=5),
            ###              pad_value(optional, default=0)]
            - [pfcand_pt_log_nopuppi, 1, 0.5]
            - [pfcand_e_log_nopuppi, 1.3, 0.5]
            - pfcand_etarel
            - pfcand_phirel
            - [pfcand_abseta, 0.6, 1.6]
            - pfcand_charge
            - pfcand_isEl
            - pfcand_isMu
            - pfcand_isGamma
            - pfcand_isChargedHad
            - pfcand_isNeutralHad
            - [pfcand_VTX_ass, 4, 0.3]
            - pfcand_lostInnerHits
            - [pfcand_normchi2, 5, 0.2]
            - [pfcand_quality, 0, 0.2]
            - [pfcand_dz, 0, 180]
            - [pfcand_dzsig, 0, 0.9]
            - [pfcand_dxy, 0.0, 300]
            - [pfcand_dxysig, 0, 1.0]
            - [pfcand_btagEtaRel, 1.5, 0.5]
            - [pfcand_btagPtRatio, 0, 1]
            - [pfcand_btagPParRatio, 0, 1]
            - [pfcand_btagSip3dVal, 0, 100]
            - [pfcand_btagSip3dSig, 0, 0.5]
            - [pfcand_btagJetDistVal, 0, 40]
    pf_vectors:
        length: 128
        pad_mode: wrap
        vars:
            - [pfcand_px, null]
            - [pfcand_py, null]
            - [pfcand_pz, null]
            - [pfcand_energy, null]
    pf_mask:
        length: 128
        pad_mode: wrap
        vars:
            - pfcand_mask
    sv_features:
        length: 10
        pad_mode: wrap
        vars:
            - [sv_pt_log, 4, 0.6]
            - [sv_mass, 1.2, 0.3]
            - sv_etarel
            - sv_phirel
            - [sv_abseta, 0.5, 1.6]
            - [sv_ntracks, 3, 1]
            - [sv_normchi2, 0.8, 0.6]
            - [sv_dxy, 0.4, 0.25]
            - [sv_dxysig, 7, 0.02]
            - [sv_d3d, 0.5, 0.2]
            - [sv_d3dsig, 7, 0.02]
    sv_vectors:
        length: 10
        pad_mode: wrap
        pad_mode: wrap
        vars:
            - [sv_px, null]
            - [sv_py, null]
            - [sv_pz, null]
            - [sv_energy, null]
    sv_mask:
        length: 10
        pad_mode: wrap
        vars:
            - sv_mask

